customCSS:
body {
    font-family: HelveticaNeueW01-55Roma, Helvetica, Arial, sans-serif;
}
h1, h2, h3, h4, h5, h6 {
    font-family: HelveticaNeueW01-55Roma, Helvetica, Arial, sans-serif;
}
.ilmn-font-header-container {
    padding: 105px 0;
}
.ilmn-font-header {
    font-family: "HelveticaNeueW01-MdExt", Helvetica, Arial, sans-serif!important;
    font-size: 44px !important;
    line-height: 50px;
    letter-spacing: 1px;
    font-weight: 100;
    text-align: center;
    color: #fff;
}
.forceCommunityRichText h3 {
    font-family: HelveticaNeueW01-55Roma, Helvetica, Arial, sans-serif;
}

/*Start Tile Menu*/
.forceCommunityTileMenuItem .imagePreview {
	height: 170px !important;
}
.forceCommunityTileMenuItem .tileLabel {
	color: #666 !important;
    background-color: #efefef !important;
}
/*End Tile Menu*/

/*Start Ideas Exchange*/
.idea-item {
  border: solid 1px #dddddd;
  margin-bottom: 20px !important;
}

.idea-item .slds-theme_shade {
  background-color: #efefef !important;
}

.idea-item .info img {
    max-width: 65px !important;
    display: block !important;
    margin: 0 auto !important;
}

.bedrockLghtIdeas .header {
    margin-bottom: 2em;
}
/*End Ideas Exchange*/


h2.contentTitle {
    font-size: 34px !important;
    font-family: "HelveticaNeueW01-MdExt", Helvetica, Arial, sans-serif;
    letter-spacing: 1px;
    font-weight: 100;
}

